import './App.css';
import React, {useState} from "react";
import 'antd/dist/antd.css'
import './index.css'
import InputBox from './component/Input'
import {Button, Form, PageHeader} from "antd";


function App() {
  return (
    <div className="App">
      <div>
          <PageHeader>Content Analyzer</PageHeader>
          <div>
              <InputBox/>
              <Form
                  name="basic"
                  labelCol={{
                      span: 8,
                  }}
                  wrapperCol={{
                      span: 16,
                  }}
                  initialValues={{
                      remember: true,
                  }}
                  autoComplete="off"
              />
          </div>
          <div>
              <Button
                  type="primary"
                  size="large"
              >
                  Summarize
              </Button>
          </div>

      </div>


    </div>
  );
}

export default App;
